import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getDividerUtilityClass(slot) {
  return generateUtilityClass('JoyDivider', slot);
}
const dividerClasses = generateUtilityClasses('JoyDivider', ['root', 'vertical', 'insetContext', 'insetNone']);
export default dividerClasses;
